Sir James Paul McCartney, MBE (born 18 June 1942) is an English rock singer, bass guitarist, songwriter, composer, multi-instrumentalist, entrepreneur, record producer, film producer and animal-rights activist. He gained worldwide fame as a member of The Beatles, with John Lennon, George Harrison, and Ringo Starr. McCartney and Lennon formed one of the most influential and successful songwriting partnerships and &quot;wrote some of the most popular music in rock and roll history&quot;.[1] After leaving The Beatles, McCartney launched a successful solo career and formed the band Wings with his first wife, Linda Eastman McCartney, and singer-songwriter Denny Laine. He has worked on film scores, classical music, and ambient/electronic music; released a large catalogue of songs as a solo artist; and taken part in projects to help international charities.




